func LoadDefaultTexture() string {
	return loadTexture("default-texture", texture)
}
func LoadDefaultRetroAtlas() string {
	return loadTexture("default-retro-atlas", retro)
}
func LoadDefaultCursors() string {
	return loadTexture("default-cursors", cursors)
}
func LoadDefaultUserInterface() string {
	return loadTexture("default-user-interface", ui)
}
func LoadDefaultInput() string {
	return loadTexture("default-input", input)
}
func LoadDefaultIcons() string {
	return loadTexture("default-icons", icons)
}
func LoadDefaultPatterns() string {
	return loadTexture("default-patterns", patterns)
}

func LoadDefaultSoundsUserInterface() [10]string {
	var soundIds = [10]string{
		loadSound("ui-on", on), loadSound("ui-off", off),
		loadSound("ui-in", in), loadSound("ui-out", out),
		loadSound("ui-yes", yes), loadSound("ui-no", no),
		loadSound("ui-high", high), loadSound("ui-medium", medium), loadSound("ui-low", low),
		loadSound("ui-click", click),
	}

	return soundIds
}

// region private

func tryCreateWindow() {
	if !rl.IsWindowReady() {
		window.Recreate()
	}
}
func loadTexture(id, b64 string) string {
	tryCreateWindow()

	var _, has = internal.Textures[id]
	if has {
		UnloadTextures(id)
	}

	var imgData, _ = base64.StdEncoding.DecodeString(b64)
	var decompressed = storage.Decompress(imgData)
	var image = rl.LoadImageFromMemory(".png", decompressed, int32(len(decompressed)))
	var tex = rl.LoadTextureFromImage(image)

	internal.Textures[id] = &tex
	rl.UnloadImage(image)
	return id
}
func loadSound(id, b64 string) string {
	tryCreateWindow()

	if !rl.IsAudioDeviceReady() {
		rl.InitAudioDevice()
	}

	var _, has = internal.Sounds[id]
	if has {
		UnloadSounds(id)
	}

	var raw, _ = base64.StdEncoding.DecodeString(b64)
	var decompressed = storage.Decompress(raw)

	var wave = rl.LoadWaveFromMemory(".mp3", decompressed, int32(len(decompressed)))
	var sound = rl.LoadSoundFromWave(wave)
	internal.Sounds[id] = &sound
	rl.UnloadWave(wave)

	return id
}

